import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

class AppList extends React.Component{

constructor(props){
  super(props);
  this.state = {
			users:[]
		};

  this.onUserClicked=this.onUserClicked.bind(this);		
}   
onUserClicked(evt){

	let tmp = document.getElementById("User").className;
	console.log(tmp);

}
componentDidMount() {

	fetch("https://ti-react-test.herokuapp.com/users")
	     .then(res => res.json())
	     .then((response) => {

	         this.setState({
	           users:response
	         });

			})
	     .catch(err => {

	     	 this.setState({
	     	 	users:[],
	     	 	error:err
	     	 });

	     });
}


render(){

 const userList = this.state.users.map((item) => (

     <App
        key={item.id}
        user_id={item.id}
        name={item.name}
        job={item.occupation}
        email={item.email}
        bio={item.bio}
        click={this.onUserClicked}
     />
 	));

   return(
      <div id='list_div'>
       {userList}
      </div>


   	);
}
}

ReactDOM.render(<AppList/>, document.getElementById('root'));
